import React from "react";
import "../style/Ecommerce_style.css";

const PDFs_Ecommerce = () => {
  return (
    <>
      <div class="row justify-content-center">
        <div class="col-lg-4 col-md-4 col-sm-8">
          <div class="card">
            <div class="card-body">
              <div class="image">
                <a href="https://sotooracademy.com/item-detail/%D8%AE%D8%B7%D8%A9-%D8%B4%D8%A7%D9%85%D9%84%D8%A9-%D9%84%D9%84%D9%82%D8%AF%D8%B1%D8%A7%D8%AA">
                  <img
                    src="https://sotooracademy.com/public/data/items/study_plan.jpg"
                    alt=""
                  />
                </a>
              </div>
            </div>
          </div>
        </div>
        <div class="col-lg-4 col-md-6 col-sm-8">
          <div class="card">
            <div class="card-body"></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default PDFs_Ecommerce;
